It's useful to think about types when composing functions, for example: const multBy10 = (a: number): number => a * 10;
const increment = (a: number): number => a + 1; Both these functions take a number and return a number. Their type signatures are number => number. If we want to compose these two, we can think of "plugging" the ouput of the first to the input of the second function, like this: A B C
number => number => number
^- increment -^ ^-- multBy10 --^ If we have a function increment (A => B), and a function multBy10 (B => C), we can create a new function that would have a type signature A => C import { flow } from "fp-ts/lib/function"; const composedFn = flow(increment, multBy10);
composedFn(1); // 20 This is equivalent to: const result = multBy10(increment(1)); // 20 You will notice that the order is different. With flow, we can read from left to right, while with traditional approach we would have to read from the inside out. flow(a, b, c)(1) === c(b(a(1)));

