We can get some type safety by returning nullable types and using optional chaining operator. If an expression can return some type A or null, we can ensure that the return type of the expression is A | null thus forcing us to check and narrow down the type before use. const result = Math.random() > 0.5 ? { nested: { value: 1 } } : null
// { nested: { value: number } } | null const checkedValue = result?.nested?.value
// number | undefined if (checkedValue) { // Only here have we finally narrowed our type to `number` ...
} We can even create a generic type helper for this approach, Nullable type Nullable<T> = T | null; There are a couple of problems with this approach: we are forced to use if statements which are brittle, poorly legible and can lead to some complex states it's harder to compose functions Consider the following example of functions (whose implementation doesn't matter, but their types do): declare function getName(id: string): Nullable<string>;
declare function formatName(name: string): string;
declare function countLetters(name: string): number; getName can possibly fail, and so we return a Nullable<string> (string | null). The problem arises if we try to combine this function with others like this: pipe("id", getName, formatName, countLetters);
// ^-- type `null` is not assignable to type `string` We get an error type null is not assignable to type string . We now have to introduce manual checking with if statements which leads to decreased readability. If the functions are used a lot, in order to avoid this boilerplate we might be tempted to handle this check inside formatName function and decide to rewrite it as: declare function formatName(name: Nullable<string>): Nullable<string>; Of course, now we've created another problem because we have to do the same to countLetters and any other function in this chain, making our code a lot less type safe. We've also increased coupling between these functions. Type signature of formatName shouldn't reflect possibly missing data, that's the concern of getName function.

