In the last chapter we've introduced a pattern for dealing with missing values and failed computations, Option. Unfortunately, Option can only tell us that there is a missing value (by returning None), but it can't tell us why is that the case. If we wanted to capture this additional context, we need another abstraction, Either. We can define it as: type Left<E> = { readonly _tag: "Left"; readonly left: E;
}; type Right<A> = { readonly _tag: "Right"; readonly left: A;
}; type Either<E, A> = Left<E> | Right<A>; Using tagged union pattern, we can now assign data to both branches, left and right . By convention, left represents a failure and right represents a successful outcome (right, correct).

