// constructors
const left = <E = never, A = never>(e: E): Either<E, A> => ({ _tag: "Left", left: e,
});
const right = <E = never, A = never>(a: A): Either<E, A> => ({ _tag: "Right", right: a,
}); // guards
const isLeft = <E, A>(ma: Either<E, A>): ma is Left<E> => ma._tag === "Left";
const isRight = <E, A>(ma: Either<E, A>): ma is Right<A> => ma._tag === "Right"; Similar to what we've seen with Option, by having these low level constructors and guards we can now construct fromPredicate and match functions: // Constructs a Right instance if predicate returns true, otherwise returns Left
const fromPredicate = <E, A>(predicate: (a: A) => boolean, onLeft: (a: A) => E) => (value: A): Either<E, A> => predicate(value) ? right(value) : left(onLeft(a)); fromPredicate( (n) => n > 5, (n) => `${n} was NOT greater than 5`
)(1); // Left<number>
fromPredicate( (n) => n > 5, (n) => `${n} was NOT greater than 5`
)(6); // Right<number> fromPredicate is very similar to the one used with Option, the only difference being that it needs additional input argument, onLeft, a function that will create a value we can attach to Left instance

