const match = <E, A, C>(onLeft: (e: E) => B, onRight: (a: A) => C) => (ma: Either<E, A>) => isLeft(ma) ? onLeft(ma.left) : onRight(ma.right); pipe( left("failed to fetch"), match( (errorMessage) => `error: ${errorMessage}`, (result) => result + 1 )
); // "error: failed to fetch" pipe( right(100), match( (errorMessage) => `error: ${errorMessage}`, (result) => result + 1 )
); // 101 match is also very similar, the only difference is that onLeft handler now "holds" a value because Left instance is parametricized by a type (Left<E>), compared to None which cannot hold any value. In fact, all af the helpers we've defined for Option can be defined for Either as well, with the main difference of having to provide a value for Left instance. Implementation of these methods will be left as an exercise for reader.

