const map = <A, B>(f: (a: A) => B) => (fa: Option<A>): Option<B> => isNone(fa) ? none : some(f(fa.value)); map takes two arguments (curried) a function f that transforms some value (A => B) a Functor fa ("Functor of type A"), in our case Option<A> if fa, our Option we're operating on, is None, then the result is also a None - we've essentially bypassed this operation and mapping function was not applied. If our Option is a Some instance, then we apply our function to it's underlying value. This gives us an ability to chain operations that can produce None, without worrying about manual value checking. We can refactor our nullable types example from chapter 3 like this: declare function getName(id: string): Option<string>;
declare function formatName(name: string): string;
declare function countLetters(name: string): number; pipe( "id", getName, // <-- returns an Option<string> map(formatName), // <-- returns an Option<string> map(countLetters), // <-- returns an Option<number> getOrElse(() => 0) // return the final value if `Some`, otherwise return 0
); // number We have used pure functions formatName and countLetters inside of a context of potentially missing value and we were able to decouple our functions. map lets us gradually build up the result while staying inside our Option container, all the while never needing to worry about a possibly missing state.

